import React from 'react';

const Task = (props) => {
  const { text, date, deleteBtn, doneBtn } = props.task;

  handleDeleteBtn = () => {
    this.props.deleteBtn()
  }

  return (
    <div>
      <h4>

        <strong>{text}</strong> - do <span style={{ color: "darkblue" }}> {date}</span>

        <button onClick={this.handleDoneBtn}>Zostalo zrobione</button>
        <button onClick={this.handleDeleteBtn}>X</button>

      </h4>
    </div>
  );
}

export default Task;
